import React from "react"
import './App.css';

function About(props) {
  return (
    <div>
      <h1>About</h1>

	    <p>Hello there, welcome to my website! Did you find the secret game? Hint: Click on my name.</p>
	    <p>
	      A little bit about myself; I grew up in Madison WI, went to the University of Colorado Boulder to study Mechanical Engineering, and after graduating joined a start-up from San Francisco where I have been doing Web Development ever since. 
	    </p> 
	    <p>I am currently a Front-End Web Developer at GradentOne, where for the past few years, I've been lucky enough to help build their product from the ground up. GradientOne's is a test automation cloud platform with a web browser interface and a robust API for those who like to dig deeper. GradientOne enables test engineers to do asset utilization tracking, hardware test automation, test data acquisition and archiving, as well as advanced data analytics.</p>

	    <a href="https://www.gradientone.com/">Go to GradientOne.com</a>


    </div>
  )
}

export default About;
